script: |
  super -f text -I q5326.spq | sort > q5326.out

inputs:
  - name: q5326.spq
    data: |
      SELECT + col2 + + col1 + - 64 col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - - col1 ) >= - col1 * - - 83 + + ( - CAST ( NULL AS INTEGER ) );
  - name: tab1

outputs:
  - name: q5326.out
    data: |
